import { UploadFile } from 'antd';
import { makeAutoObservable } from 'mobx';

interface Route {
  id: string;
  author: string;
  place: string;
  name: string;
  description: string;
  markersArray: Marker[];
}

interface Marker {
  id: number;
  name: string;
  description: string;
  coordinates: string;
  imagesArray: UploadFile[];
}

interface User {
  id: string;
  name: string;
  email: string;
  description: string;
  isOrg: boolean;
  routesArray: Route[];
}

class MainStore {
  resultsArray: Array<Route> = [];

  imagesArray: UploadFile[] = [];

  marker: Marker | null = null;

  markers: Marker[] = [];

  routes: Route[] = [
    {
      id: '1',
      name: 'Поездка по городу',
      place: 'Москва',
      description:
        'Я шагаю по Москве,\nКак шагают по доске.\nЧто такое — сквер направо\nИ налево тоже сквер.',
      markersArray: [
        {
          id: 1,
          name: 'Парк Горького',
          coordinates: '37.59088439941408,55.7208140653624',
          imagesArray: [
            {
              uid: 'rc-upload-1712679953275-3',
              lastModified: 1712592927657,
              lastModifiedDate: '2024-04-08T16:15:27.657Z',
              name: 'kartinka-1-bd35.jpg',
              size: 300734,
              type: 'image/jpeg',
              percent: 0,
              originFileObj: {
                uid: 'rc-upload-1712679953275-3',
              },
              thumbUrl:
                'data:image/png;base64,',
            },
            {
              uid: 'rc-upload-1712679953275-5',
              lastModified: 1712592946305,
              lastModifiedDate: '2024-04-08T16:15:46.305Z',
              name: 'img01.jpg',
              size: 674681,
              type: 'image/jpeg',
              percent: 0,
              originFileObj: {
                uid: 'rc-upload-1712679953275-5',
              },
              thumbUrl:
                'data:image/png;base64,',
            },
          ],
        },
        {
          id: 2,
          name: '',
          coordinates: [37.798251342773455, 55.7324392280244],
          imagesArray: [],
        },
        {
          id: 3,
          name: '',
          coordinates: [37.57715148925783, 55.79051291760934],
          imagesArray: [],
        },
      ],
      author: 'Kirill Makarov',
    },
  ];

  route: Route | null = null;

  user: User | null = {
    id: '1',
    name: 'Kirill Makarov',
    email: 'kirill@gmail.com',
    description:
      'Шапка профиля — это первое, на что смотрит пользователь в вашем аккаунте. По первым строчкам человек понимает, что это за страница и интересна ли она ему, поэтому важно грамотно оформить описание и кратко презентовать бренд посетителю.',
    routesArray: this.routes,
    isOrg: false,
  };

  constructor() {
    makeAutoObservable(this);
  }

  getResultsArray(filter: string) {
    this.resultsArray = this.routes?.filter(
      (route) =>
        route.name.toLowerCase().includes(filter.toLowerCase()) ||
        route.place.toLowerCase().includes(filter.toLowerCase()),
    );
  }

  setResultsArray(array: Array<Route>) {
    this.resultsArray = array;
  }

  setImagesArray(array: UploadFile[]) {
    this.imagesArray = array;
  }

  addMarker(marker: Marker) {
    this.markers.push(marker);
  }

  editMarker(changedMarker: Marker) {
    this.markers = this.markers.map((marker) =>
      marker.id === changedMarker.id ? changedMarker : marker,
    );
  }

  setMarker(marker: Marker | null) {
    this.marker = marker;
  }

  getMarker(id: number) {
    return this.markers.find((marker) => marker.id === id);
  }

  addRoute(route: Route) {
    this.routes.push(route);
  }

  getRoute(id: string) {
    this.route = this.routes.find((route) => route.id === id) || null;
    this.markers = this.route?.markersArray || [];
  }
}

const mainStore = new MainStore();
export default mainStore;
